def run_in_threads_and_collect_results(target, kwargs_list, max_threads=10):
    with ThreadPoolExecutor(max_workers=max_threads) as executor:
        futures = [executor.submit(target, **kwargs) for kwargs in kwargs_list]
    return [f.result() for f in futures]

# 判断给定日期是否在当前日期之前的一定天数内
def within_days(date: str, days: int = 15) -> bool:
    try:
        if all(char in date for char in ["月", "日"]) and "年" not in date:
            current_year = datetime.now().year
            date_time = datetime.strptime(str(current_year) + "年" + date, "%Y年%m月%d日")
        else:
            date_time = datetime.strptime(date, "%Y年%m月%d日")
    except ValueError:
        return False
    today = datetime.today().date()
    delta = (today - date_time.date()).days
    return 0 <= delta <= days

# 计时装饰器
def timer(func):
    @functools.wraps(func)
    async def wrapper(*args, **kwargs):
        loop = asyncio.get_event_loop()
        start_time = loop.time()
        result = await func(*args, **kwargs)
        end_time = loop.time()
        elapsed_time = end_time - start_time
        print(f"{func.__name__} 耗时：{elapsed_time:.2f} 秒")
        return result
    return wrapper

def get_bar_date(the_day):
        return datetime.datetime.strptime(the_day, '%Y%m%d').strftime('%Y-%m-%d')

# 定义一个函数，参数是一个字符串，格式为"YYYY-MM-DD"
def previous_day(the_day):
    # 将字符串转换为datetime对象
    the_day = datetime.datetime.strptime(the_day, "%Y-%m-%d")
    # 减去一天，得到前一天的datetime对象
    previous = the_day - datetime.timedelta(days=1)
    # 将datetime对象转换为字符串，格式为"YYYY-MM-DD"
    previous = previous.strftime("%Y-%m-%d")
    # 返回前一天的字符串
    return previous

# 定义一个函数，输入 yyyy-mm-dd 格式的字符串，输出 yyyy-mm-dd 格式的字符串，表示后面一天的日期
def get_next_day(input_str):
    # 将输入字符串转换为 datetime 对象
    input_dt = datetime.datetime.strptime(input_str, "%Y-%m-%d")
    # 将 datetime 对象加上一天
    output_dt = input_dt + datetime.timedelta(days=1)
    # 将 datetime 对象格式化为 yyyy-mm-dd 格式的字符串
    output_str = output_dt.strftime("%Y-%m-%d")
    # 返回输出字符串
    return output_str

def convert_utc_to_eastern(utc_time):
        eastern_time = utc_time + datetime.timedelta(hours=8)
        return eastern_time

def convert_timestamp_to_date_string(timestamp):
    date_object = datetime.datetime.fromtimestamp(timestamp)
    date_string = date_object.strftime("%Y-%m-%d %H:%M:%S")
    return date_string

def convert_date_string_to_timestamp(date_string):
    # 将日期字符串转换为 datetime 对象
    date_object = datetime.datetime.strptime(date_string, "%Y-%m-%d %H:%M:%S")
    # 将 datetime 对象转换为时间戳
    timestamp = date_object.timestamp()
    return int(timestamp)

def get_current_timestamp():
    # 获取当前的时间戳
    return int(time.time())

def filter_words(text):
    A = ahocorasick.Automaton()
    for index, word in enumerate(sensitive_word_list):
        A.add_word(word, (index, word))
    A.make_automaton()
    result = []
    for end_index, (insert_order, original_value) in A.iter(text):
        start_index = end_index - len(original_value) + 1
        result.append((start_index, end_index))
    for start_index, end_index in result[::-1]:
        text = text[:start_index] + '*' * (end_index - start_index + 1) + text[end_index + 1:]
    return text

def date_to_ctime(date_str):
    """Convert UTC date to milliseconds
    If using offset strings add "UTC" to date string e.g. "now UTC", "11 hours ago UTC"
    See dateparse docs for formats http://dateparser.readthedocs.io/en/latest/
    :param date_str: date in readable format, i.e. "January 01, 2018", "11 hours ago UTC", "now UTC"
    :type date_str: str
    """
    # get epoch value in UTC
    epoch = datetime.datetime.utcfromtimestamp(0).replace(tzinfo=pytz.utc)
    # parse our date string
    d = dateparser.parse(date_str)
    # if the date is not timezone aware apply UTC timezone
    if d.tzinfo is None or d.tzinfo.utcoffset(d) is None:
        d = d.replace(tzinfo=pytz.utc)
    # return the difference in time
    return int((d - epoch).total_seconds())

def read_json_file(json_file_path):
    with open(json_file_path, 'r', encoding='utf-8') as f:
        data = json.load(f)
    return data


def replace_newlines(text):
    """
    将字符串中的 '/n' 替换为 '\n'。

    :param text: 输入的字符串
    :return: 替换后的字符串
    """
    return text.replace('/n', '\n')

